import React from 'react'
import styles from './index.less'

export default class SectionCard extends React.Component{
  constructor(props){
    super(props)

  }

  render() {
    const {title} =  this.props
    return (
      <>
        <section>
          <h2>{title}</h2>
        </section>
        <style jsx>
          {
            styles
          }
        </style>
      </>
    )
  }
}
